battery and outputs signal to the &quot;slave&quot; arm via the ethernet port. This &quot;master&quot; arm has a 1:1 motion with the slave arm.','','YES',0,'','','','',0,'173.245.55.163','','104.162.155.69',0,''),(3229,27,'userpics/10005/','Controller_Side.jpg',579229,614469,1536,2048,247,'2019-03-24 16:10:37',1367721320,5,0,0,'Robot Arm Controller Side','Buffalo Grove High School&#039;s robot arm controller side. See description in the Isometric photo. Shows structure of casing and ethernet cable mate. Won 1st in the state of Illinois with a perfect score + height.','','YES',0,'','','','',0,'173.245.55.163','','104.162.155.69',0,''),(3230,27,'userpics/10005/','Controller_top.jpg',632272,669280,1536,2048,228,'2019-03-24 16:10:38',1367721538,5,0,0,'Robot Arm Controller Top ','Buffalo Grove High School&#039;s robot arm controller, shows removed E-plate with wiring. The upper barrier strip is where the input wires (from the controller) are going before the Arduino. The output wires are going to the side barrier strip to the ethernet port. This is done to stop any &#039;yanking&#039; of wires from damaging the arduino.','','YES',0,'','','','',0,'173.245.55.163','','104.162.155.69',0,''),(3231,34,'userpics/10005/','gravity_breaks.jpg',315878,341432,1536,2048,571,'2019-10-10 02:49:48',1367721761,5,0,0,'gravity Vehicle Breaking System','Buffalo Grove High School&#039;s gravity vehicle. Standard wing nut breaking system on McMaster Carr flanged open ball bearings. ','','YES',0,'','','','',0,'173.245.55.163','','72.234.177.13',0,''),(3232,34,'userpics/10005/','gravity_iso.jpg',433734,464886,1536,2048,491,'2019-10-09 12:19:31',1367722050,5,0,0,'Gravity Vehicle Isometric ','Buffalo Grove High School&#039;s gravity vehicle. 3D printed with ABS plastic. \r\nUses a 1/4&#039;&#039; threaded rod for both axles on McMaster Carr open flanged ball bearings and rubber 2  7/8 diameter wheels. Has mass holders to vary mass for each distance. Accurate to 2 cm when functioning correctly, placed 4th the state of Illinois after an alignment error. mrsteven','','YES',0,'','','','',0,'173.245.55.163','','12.180.225.130',0,''),(3233,34,'userpics/10005/','gravity_ramp.png',1470968,1711333,640,960,483,'2019-10-10 02:49:58',1367722255,5,0,0,'Gravity Vehicle Ramp','Buffalo Grove High School&#039;s gravity vehicle ramp. Made with square 1/2&#039;&#039; tubing rolled into an arc. From there, ribs were added to ensure no shifts in the &quot;bones.&quot; 1/16&#039;&#039; steel plasma cut surface with laser drawn lines for alignment. Not shown is a rifle scope attached to the top bar used to align with the target distance using a quarter. Mrsteven','','YES',0,'','','','',0,'173.245.55.163','','72.234.177.13',0,''),(3234,34,'userpics/10005/','gravity_top.jpg',419150,448070,1536,2048,373,'2019-10-09 19:24:04',1367722397,5,0,0,'Gravity Vehicle Top','Buffalo Grove High School&#039;s gravity vehicle. See description in the isometric picture. Shows line down the center used to line up to the lines on the ramp and BGHS logo. Mrsteven','','YES',0,'','','','',0,'173.245.55.163','','131.204.254.86',0,''),(3235,33,'userpics/10005/','maglev_front.jpg',454442,487685,2048,1536,1184,'2019-07-04 02:28:46',1367722609,5,0,0,'Maglev Front','Buffalo Grove High School&#039;s Maglev. Made from 35mm RC Venom fireball 13X2 motor, duct fan, 3D printed chassis, high discharge battery and switch. Ball bearings were added on sides to lessen surface area and friction with the track. Nails and sheet lead were used as weights. Mrsteven','','YES',0,'','','','',0,'173.245.55.163','','18.207.236.245',0,''),(3236,33,'userpics/10005/','maglev_iso.jpg',372057,404171,2048,1536,1217,'2019-07-04 02:28:46',1367722762,5,0,0,'maglev Isometric','Buffalo Grove High School&#039;s maglev. Uses a 3D printed chassis to hold the motor and duct fan in place and hole for the dowel rod. Uses a venom fireball 13x2 motor with duct fan, ball bearing sliders, switch and high discharge batteries (not shown). Completes a 95 cm run in .6 seconds with a 1 kg mass. Mrsteven','','YES',0,'','','','',0,'173.245.55.163','','18.207.236.245',0,''),(3237,33,'userpics/10005/','maglev_side.jpg',418220,447117,2048,1536,1071,'2019-07-04 02:28:52',1367722861,5,0,0,'Maglev Side','Buffalo Grove High School&#039;s maglev. See description in isometric view. Shows tape to hold nails and lead sheets with rollers. mrsteven','','YES',0,'','','','',0,'173.245.55.163','','18.207.236.245',0,''),(3238,33,'userpics/10005/','maglev_trial.png',1292117,1515464,640,960,1067,'2019-09-04 05:40:46',1367722967,5,0,0,'maglev trial ','Buffalo Grove High School&#039;s maglev trial. Shows stripped maglev train with only motor and fan with no masses. 3D printed chassis forms around motor and duct fan. See description in isometric view. mrsteven','','YES',0,'','','','',0,'173.245.55.163','','173.71.124.107',0,''),(3239,27,'userpics/10005/','Robot_alone_iso.jpg',409065,438373,1536,2048,279,'2019-03-24 16:11:09',1367723359,5,0,0,'BGHS Robot Arm','Buffalo Grove High School&#039;s Robot Arm. 1st place at IL state competition with perfect score + height. Vex claw, with lynxmotion wrist and shoulder joint. Rotation Base custom made (see base picture for description) and conduit piping for structure. Has a spring counter weight to reduce strain on the shoulder joint. Shows height task apparatus and bag for the ping pong ball. Uses neodymium hard drive magnets to pick up nails. mrsteven','','YES',0,'','','','',0,'173.245.55.163','','104.162.155.69',0,''),(3240,27,'userpics/10005/','robot_height_one.jpg',360625,391132,1536,2048,235,'2019-03-18 21:08:20',1367723546,5,0,0,'BGHS Robot Arm Trial','Buffalo Grove High School&#039;s robot arm trial 1. same robot as used in the state competition but the height task was changed. Timing belt pulleys connect the arm to the double-drive racketing tool, when the arm rotates, the racket spins in one direction and winds the fishing line, raising the height task. Was replaced by a motor for quicker lifting and mechanical advantage. mrsteven','','YES',0,'','','','',0,'173.245.55.163','','104.162.155.69',0,''),(3241,27,'userpics/10005/','Robot_Height_Task.jpg',494127,529616,1536,2048,227,'2019-03-18 21:08:21',1367723727,5,0,0,'BGHS Height Task','Buffalo Grove High School&#039;s Robot Arm Height Task. The height task has fishing line hooked onto the base and the apparatus leading to the motor. When the motor is activated, it helps rotate the base laterally, scoring a point when an object is in the claw, then is cut by the xacto blade. When the run is complete the motor is again activated (by the button shown) and winds up the string strung around the apparatus and the bag. The bag shoots to the top of the task and can reach well over 3 meters). Mrsteven','','YES',0,'','','','',0,'173.245.55.163','','104.162.155.69',0,''),(3242,27,'userpics/10005/','Robot_iso.jpg',489945,526117,1536,2048,246,'2019-03-18 21:08:23',1367723885,5,0,0,'BGHS Robot Arm Complete','Buffalo Grove High School&#039;s robot arm. Shows Master and Slave arm with height task button. Won 1st place in the state of Illinois with a perfect score and height. See descriptions in the isometric, height task, and base rotation views for further descriptions. mrsteven','','YES',0,'','','','',0,'173.245.55.163','','104.162.155.69',0,''),(3243,27,'userpics/10005/','robot_joint.jpg',386986,417507,1536,2048,211,'2019-03-18 21:08:32',1367724014,5,0,0,'BGHS Robot Arm joint','Buffalo Grove High School&#039;s robot arm. Shows the joint between VEX claw and lynxmotion joint kit. Simple holes in the claw for the L brackets that connect to the piping allows easy conversion from the two manufacturers. mrsteven','','YES',0,'','','','',0,'173.245.55.163','','104.162.155.69',0,''),(3244,27,'userpics/10005/','Robot_Power.jpg',466353,502466,1536,2048,1865,'2019-03-18 21:08:33',1367724212,5,0,0,'BGHS Robot Arm Electrical','Buffalo Grove High School&#039;s  Robot arm. Shows the electrical sequence. The servo cables feed into the barrier strip, then into the ethernet port for going out to the controller. 2 of the barriers contain the power from the 6V 5000mah battery that are connected to the servos. The ends of servo extension cables were spliced to connect bare wires to the terminal block. mrsteven','','YES',0,'','','','',0,'173.245.55.163','','104.162.155.69',0,''),(3245,27,'userpics/10005/','Robot_Rotation.jpg',415650,443204,1536,2048,221,'2019-03-18 21:08:36',1367724501,5,0,0,'BGHS Robot Arm Base Rotation','Buffalo Grove High School&#039;s Robot Arm. Shows the custom base used for the robot arm. Is made from 1/2&#039;&#039; polycarb pieces as the legs and a lazy Susan bearing for the rotation. An aluminum 1X4X4&#039;&#039; block was milled out using a Haas CNC mill to convert the lazy susan&#039;s rotation into the salvaged concuit piping. The servo is connected to the CNC part and wooden blocks used to keep in place so that when the output shaft rotates, the robot does, not the servo body. Screws used as hooks for height task. Mrsteven','','YES',0,'','','','',0,'173.245.55.163','','104.162.155.69',0,''),(3246,27,'userpics/10005/','robot_trial.jpg',372587,403443,1224,1632,1934,'2019-03-18 21:08:36',1367724557,5,0,0,'Robot Arm Initial ','Buffalo Grove High School&#039;s Initial Robot Arm. Without height task or counter spring. Shows basic structure. Mrsteven','','YES',0,'','','','',0,'173.245.55.163','','104.162.155.69',0,''),(3247,31,'userpics/','130507-185325.jpg',71905,90870,640,480,899,'2019-10-06 20:58:33',1367967600,0,10000,1,'','','','YES',0,'','','','',0,'','','24.14.147.184',0,''),(3248,31,'userpics/','130507-185615.jpg',66819,84472,640,480,774,'2019-10-07 19:31:14',1367967650,0,0,0,'','','','YES',0,'','','','',0,'','','66.4.9.114',0,''),(3249,31,'userpics/','130507-185619.jpg',66871,84618,640,480,611,'2019-10-07 19:31:20',1367967654,0,0,0,'','','','YES',0,'','','','',0,'','','66.4.9.114',0,''),(3250,27,'userpics/','CARL-1.jpg',180716,196005,2048,1362,575,'2019-07-06 11:49